import './App.css';
import React, { useEffect, useState} from 'react';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch('http://localhost:5000/getData')
      .then((response )=>{
        setData(response.json());
        console.log(response.json());
      })}
  , []);


  return (
    <div className="App">

    </div>
  );
}

export default App;
